import React from 'react';
// import video_img from "../../img/Video Yaroslav.png";
import { videoData } from "../MainPage/Video"

export default function VideoBlock(props) {
    const getText = props;

    return (
    <div className="ecosystem-video">
        <ul className="eco-video-list flex list-reset">
            <li className="eco-video-item video-descr">
                <h3 className="video-item-title">
                    {videoData.find(ttl => ttl.id = getText).title}
                </h3>
                <p className="video-item-descr">
                    {videoData.find(ttl => ttl.id = getText).text1}
                </p>
                <p className="video-item-descr">
                    {videoData.find(ttl => ttl.id = getText).text2}
                </p>
                <span className="video-item-descr flex" style={{justifyContent: "flex-end", textAlign: "end"}}>
                {videoData.find(ttl => ttl.id = getText).name}
                    <br/>{videoData.find(ttl => ttl.id = getText).position}
                </span>
            </li>
            <li className="eco-video-item video-play">
                <img className="img" src={videoData.find(ttl => ttl.id = getText).videoImg} alt={getText.alt}></img>
            </li>
        </ul>
    </div>
  )
}
